//autogenerated:yes
//nolint:revive,govet,errcheck
package minimal

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_MAV_COMPONENT(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e MAV_COMPONENT
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := MAV_COMP_ID_ALL.MarshalText()
		require.NoError(t, err)

		var dec MAV_COMPONENT
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, MAV_COMP_ID_ALL, dec)
	})
}
